import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import List from './List';
import Home from './Home';
import IndicatorsDaily from './IndicatorsDaily'; // Import new component

const App = () => {
    return (
        <Router>
            <div className="app-container">
                <header className="app-header">
                    <h1>Welcome to the Macedonian Stock Market</h1>
                    <nav>
                        <a href="/">Home</a>
                        <a href="/list">Issuers</a>
                        <a href="/indicators-daily">Daily Indicators</a> {/* Add link to menu */}
                    </nav>
                </header>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/list" element={<List />} />
                    <Route path="/indicators-daily" element={<IndicatorsDaily />} />
                </Routes>
                <footer className="app-footer">
                    <p>&copy; 2024 Macedonian Stock Market</p>
                </footer>
            </div>
        </Router>
    );
};

export default App;
